public void  generar_expresion_binaria(IData OperandoDerecho, IData Operador, IData OperandoIzquierdo){

   String etiqueta = "L" + label_n;

   switch(Operador.valor()){
      case "+": RESULT2 = RESULT2 + "\nmov al, "  + OperandoDerecho.valor() + 
                                    "\nadd al, " + OperandoIzquierdo.valor();
                break;
      case "-": RESULT2 = RESULT2 + "\nmov al, "  + OperandoDerecho.valor() +
                                    "\nsub al, " + OperandoIzquierdo.valor();
                break;
      case "=": RESULT2 = RESULT2 + "\nmov "  + OperandoIzquierdo.valor() +  ", ax";
                break;

      case "==":RESULT2 = RESULT2 + "\nmov al, "  + OperandoDerecho.valor() + 
                                    "\ncmp al, "  + OperandoIzquierdo.valor() + 
                                    "\njnz "  + etiqueta +
                                    "\nmov al, 1"  +                 
                                    "\n" + etiqueta + ":  mov al, 0";    
                break;

      case ">=":RESULT2 = RESULT2 + "\nmov bl, "  + OperandoIzquierdo.valor() + 
                                    "\ncmp bl, "  + OperandoIzquierdo.valor() + 
                                    "\njge "  + etiqueta + 
                                    "\nmov bl, 0"  +     
                                    "\n" + etiqueta+ ":  mov bl, 1";    
                 break;
      case ">": RESULT2 = RESULT2 + "\nmov bl, "  + OperandoIzquierdo.valor() + 
                                    "\ncmp bl, "  + OperandoIzquierdo.valor() + 
                                    "\njg "  + etiqueta + 
                                    "\nmov bl, 0"  +     
                                    "\n" + etiqueta + ":  mov bl, 1";  
                 break;
      case "<=":RESULT2 = RESULT2 + "\nmov bl, "  + OperandoIzquierdo.valor() + 
                                    "\ncmp bl, "  + OperandoIzquierdo.valor() + 
                                    "\njge "  + etiqueta + 
                                    "\nmov bl, 0"  +     
                                    "\n" + etiqueta + ":  mov bl, 1";  
                  break;
      case "<":RESULT2 = RESULT2 +  "\nmov bl, "  + OperandoIzquierdo.valor() + 
                                    "\ncmp b, "  + OperandoIzquierdo.valor() + 
                                    "\njl "  + etiqueta + 
                                    "\nmov bl, 0"  +     
                                    "\n" + etiqueta + ":  mov bl, 1";  
                 break;

      case "!=":RESULT2 = RESULT2 + "\nmov al, "  + OperandoDerecho.valor() + 
                                    "\ncmp al, "  + OperandoIzquierdo.valor() + 
                                    "\njnz "  + etiqueta +
                                    "\nmov al, 0"  +                 
                                    "\n" + etiqueta + ":  mov al, 1"; 
                 break;

      case "||":RESULT2 = RESULT2 + "\nmov al, "  + OperandoDerecho.valor() + 
                                    "\nmov bl, "  + OperandoIzquierdo.valor() +
                                    "\nor ax,bx"; 
                 break;

      case "&&":RESULT2 = RESULT2 + "\nmov al, "  + OperandoDerecho.valor() + 
                                    "\nmov bl, "  + OperandoIzquierdo.valor() +
                                    "\nand al,bl"; 
                 break;
      default: System.err.println("ERROR SEMANTICO: operador "+ Operador.valor()+" requiere solo un operando"); break;
   }
      label_n++;
   
}

