public void generar_expresion_unaria(IData Operador, IData Operando){


   switch(Operador.valor()){
      case "++": RESULT2 = RESULT2 + "\nmov al, "  + Operando.valor() + 
                                     "\ninc al, " + 
                                     "\nmov " + Operando.valor() + ", al";
                break;

      case "--": RESULT2 = RESULT2 = RESULT2 + "\nmov al, "  + Operando.valor() + 
                                     "\ndec al, " + 
                                     "\nmov " + Operando.valor()+ ", al";
                break;

      case "!": RESULT2 = RESULT2 + "\nmov al, " + Operando.valor() +
                                    "\nxor al, 1";

                break;

      default: System.err.println("ERROR SEMANTICO: operador "+ Operador.valor()+" requiere dos operandos"); break;
   }
      label_n++;

}


